insert  into `artikel`(`id_artikel`,`id_user`,`id_kategori`,`judul_artikel`,`judul_seo`,`headline`,`isi_artikel`,`hari`,`tanggal`,`jam`,`gambar`,`dibaca`,`tag`) values (17,1,10,'Pengelola Pijaronline.Com mengucapkan Selamat Hari Raya Idul Fitri 1438H','pengelola-pijaronlinecom-mengucapkan-selamat-hari-raya-idul-fitri-1438h','Y','<p>Dengan segala kerendahan hati, kami dari keluarga besar pemilik dan pengelola Pijaronline.com dan Maribuatweb.info menyampaikan selamat hari raya Idul Fitri bagi kita semua kaum muslimin di seluruh dunia, semoga dengan bertemunya kita dengan hari raya ini, kita semua kembali kepada fitrah (kesucian) dan bisa menjadi lebih baik lagi. Sebagai kejutan atau sedikit hadiah bagi semua pengunjung, dengan ini kami melaunching sebuah karya baru script toko online yang dikombinasikan dengan script portal berita, dua fungsi website yang paling dicari oleh masyarakat selama ini. Semoga bermanfaat. Minal aidin wal faidzin, taqabbalalluhu minna waminkum taqabbal ya kariim.</p>\r\n<p>Muhammad Multazam, Keluarga beserta Tim Pijaronline.com</p>','Sabtu','2017-07-28','08:00:00','2424pijaronline2.jpg',50,''),(18,1,10,'Jutaan Umat Shalat Jumat di Masjidil Haram dan Masjid Nabawi','jutaan-umat-shalat-jumat-di-masjidil-haram-dan-masjid-nabawi','Y','<p>REPUBLIKA.CO.ID, JEDDAH -- Lebih dari 2,5 juta jamaah mengikuti shalat Jumat terakhir pada bulan Ramadhan di Masjidil Haram di Makkah dan Masjid Nabawi di Madinah. Jamaah turut menghadiri shalat khataman quran usai shalat tarawih di dua masjid suci itu.<br /> <br /> Dilansir dari<em> Saudi Gazette</em>, Sabtu (24/6), petugas sudah mulai mengintensifkan penerimaan sejak pagi hari. Halaman, ruang utama dan gerbang telah disiapkan demi memudahkan kelancaran masuk dan keluargnya jamaah.<br /> <br /> Menyampaikan khutbah di Masjidil Haram, Syeikh Saleh bin Muhammad Al Thalib menekankan, perbuatan terakhir jadi yang paling penting. Ia turut mengingatkan pentingnya zakat yang memang suatu kewajiban bagi umat Islam. \"Setiap individu yang hidupnya dipenuhi dengan ketaatan pada Allah SWT akan memiliki akhir yang baik, sedang siapa saja yang hidupnya penuh dengan dosa memiliki alasan untuk takut,\" kata Al Thalib. Sementara, Syeikh Abdulbari bin Awwad Al Thubaiti, memimpin shalat di Masjid Nabawi. Dalam khutbahnya, ia mendesak umat Islam untuk memanfaatkan sisa Ramadhan dengan maksimal. Ia turut menekankan agar senantiasa berdoa kepada Allah SWT. \"Manfaatkan waktu Ramadhan yang terbaik dan mohonlah kepada Allah SWT agar menerima puasa, doa, sedekah dan ibadah lain kita,\" ujar Al Thubaiti. Lebih dari 500 ribu jamaah menghadiri shalat Jum\'at di Masjid Nabawi, dan telah memenuhi setiap sudut sejak pagi. Serupa, semua lantai Masjidil Haram penuh dengan barisan jamaah yang meluas sampai ke jalan-jalan menuju Masjidil Haram.</p>','Sabtu','2017-07-28','08:00:01','7815masjidil haram.jpg',51,''),(19,1,8,'Radja Nainggolan Ucapkan Selamat Idul Fitri','radja-nainggolan-ucapkan-selamat-idul-fitri','Y','<p>REPUBLIKA.CO.ID, BRUSSELS -- Umat Islam di seluruh dunia akan melaksanakan Idul Fitri 1438 Hijriyah pada Ahad (25/6). Ucapan selamat datang dari pesohor non-Muslim bermunculan, salah satunya pesepak bola asal Belgia berdarah Indonesia, Radja Nainggolan. Gelandang AS Roma Radja Nainggolan enggan melewatkan momen spesial ini dengan memberi ucapan terlebih dulu kepada rekan dan pengikutnya di sosial media Twitter.<br /> <br /> Nainggolan yang juga memiliki banyak pengikut dari Indonesia di akun <em>Twitter-</em>nya mengucapkan selamat Lebaran kepada seluruh rekannya yang merayakan. \"Untuk semua teman saya dan pengikut yang Muslim di seluruh dunia, semoga kalian menikmati hari terakhir di bulan Ramadan. Selamat Idul Fitri,\" tulis pemain berjuluk Ninja di akun <em>Twitter-</em>nya @OfficialRadja, Sabtu (24/6).</p>\r\n<p>Nainggolan memperkuat AS Roma sejak 2014 silam. Sebelumnya, pria 29 tahun itu mengawali karier di Negeri Pizza bersama Piacenza pada 2006 hingga 2010 dan Cagliari 2010-2014. Ia lahir di Antwerp, Belgia, pada 4 Mei 1988. Dalam diri radja mengalir darah Indonesia dari ayahnya, Marianus Nainggolan.</p>','Senin','2017-07-28','08:00:02','4991radja-nainggolan-_160803125247-423.jpg',52,'hiburan'),(20,1,9,'Jusuf Kalla: Mayoritas Indonesia Muslim, Tapi tidak Radikal','jusuf-kalla-mayoritas-indonesia-muslim-tapi-tidak-radikal','Y','<p>REPUBLIKA.CO.ID, TOKYO -- Wakil Presiden Jusuf Kalla kembali menegaskan bahwa mayoritas penduduk Indonesia adalah pemeluk agama Islam atau Muslim, tapi bukan kelompok radikal atau ekstrem yang akhir-akhir mengganggu keamanan dunia melalui aksi-aksi terorisme. \"Soal ekstremisme dan radikalisme masih pertanyaannya seperti biasa, apa dan di mana, tapi tidak ada menjawabnya tentang <em>kenapa</em>, padahal radikalisme selalu terjadi di negara yang gagal, Afghanistan ada Taliban, Irak dan Suriah ada ISIS, kemudian karena tindakan semena-mena negara-negara besar kepada negara-negara itu, timbullah kemarahan, hilang harapan, <em>nah</em> timbullah radikal,\" kata Wapres di Hotel Imperial Tokyo, Jepang, Senin.</p>\r\n<p>Wapres menyampaikan hal itu dalam pidatonya di forum Nikkei \"Konferensi Internasional Ke-23: Masa Depan Asia\" yang mengambil tema \"Globalisme di Persimpangan: Langkah Asia selanjutnya\'\'. Sementara di Indonesia, Wapres mengatakan Indonesia bukan negara gagal dan Pemerintah tidak akan membiarkan paham-paham radikal dan ekstrem menyebar luas. \"Bahwa ada orang-orang yang berpikir tentang khalifah memang ada, tapi perkembangannya tidak sebesar yang dibayangkan, dan belajar dari itu, pemerintah menanggapinya dengan serius,\'\' kata dia.</p>','Minggu','2017-07-28','08:00:03','3582yusuf kalla.jpg',53,'politik'),(21,1,9,'Ketua DPR Ajak Lestarikan Nilai Pancasila','ketua-dpr-ajak-lestarikan-nilai-pancasila','Y','<p>REPUBLIKA.CO.ID, JAKARTA -- Ketua DPR RI, Setya Novanto (Setnov), mengajak seluruh elemen untuk melestarikan nilai-nilai Pancasila dalam kehidupan. Setnov mengatakan Pancasila sebagai dasar negara Republik Indonesia merupakan dasar yang sudah final.</p>\r\n<p>\'\'Hari ini, Bangsa Indonesia memperingati Hari Pancasila. Sebuah momentum peringatan yang mengembalikan memori kolektif kita sebagai anak bangsa tentang sebuah dasar negara, falsafah kehidupan berbangsa yang diperjuangkan dan dilahirkan di atas seluruh keanekaragaman dan perbedaan,\" ujar dia dalam keterangan tertulis di Jakarta, Kamis (1/6).</p>\r\n<p>Setnov mengatakan, Pancasila bukan sekedar simbol dan butir-butir yang dilafalkan, akan tetapi juga urat nadi, jati diri dan ideologi dari Bangsa Indonesia. Berbagai paham yang mengglobal di tengah bangsa Indonesia, Pancasila menjadi asas yang menyelubungi setiap watak dan pikiran masyarakat tentang bagaimana menjadi Indonesia Sejati. \"Karena itu, menjadi Indonesia adalah menghayati dan mengamalkan Pancasila,\" jelasnya. Sebagai konsensus kebangsaan, Setnov melanjutkan, para pendiri bangsa Indonesia telah memapankan Pancasila sebagai satu-satunya dasar yang melatarbelakangi visi dan misi tentang Indonesia. Karena itu, kata dia, semestinya bangsa Indonesia menolak segala bentuk pemikiran dan tindakan yang dengan sengaja menodai Pancasila sebagai nilai. \'\'Kita menentang segala bentuk aksi dan perilaku yang bertentangan dengan Pancasila sebagai dasar negara,\" ujarnya.</p>','Minggu','2017-07-28','08:00:05','251ketua dpr.jpg',56,'politik'),(22,1,9,'Polri Ajak Cegah Radikalisme dengan Berdayakan Ekonomi','polri-ajak-cegah-radikalisme-dengan-berdayakan-ekonomi','Y','<p>REPUBLIKA.CO.ID, JAKARTA -- Gerakan terorisme di Indonesia semakin intens belakangan ini. Sejumlah WNI (Warga Negara Indonesia) diketahui terlibat dalam jaringan teroris regional maupun internasiolnal. Direktorat Keamanan Negara Badan Intelijen Keamanan Polri (Kamneg Baintelkam) Polri, AKBP Syuhaimi mengimbau agar di bulan suci Ramadhan ini pihak keamanan dan elemen masyarakat bersinergi untuk mencegah masuknya paham radikalisme. Salah satu yang efektif adalah lewat pemberdayaan ekonomi. \"Ormas, ulama, pengusaha dan para aparat harus turut bersinergi,\" ujar Syuhaimi, Ahad (11/6).</p>\r\n<p>Selama ini, lanjut Syuhaimi, salah satu kendala yang sering dialami oleh para mantan napi terorisme adalah masalah ekonomi. Kondisi ini sangat terasa ketika terkait dengan masalah administrasi seperti Kartu Tanda Penduduk (KTP), Surat Keterangan Catatan Kepolisian (SKCK), dan masalah sosial lain ketika mereka kembali ke lingkungan masyarakat. \"Ke depannya semoga semua permasalahan tidak ada lagi kendala, dengan dialog akan memberikan pencerahan bagi para ikhwan bahkan dapat menjadi duta bagi para ikhwan lainnya yang masih memiliki pemahaman radikal,\" katanya.</p>\r\n<p>Sementara itu, Ketua Umum DPP Asosiasi Pedagang Kaki Lima Indonesia Ali Mahsum menjelaskan munculnya paham radikalisme disebabkan oleh kesenjangan ekonomi sosial dan adanya ketidakadilan. Ali pun mengajak seluruh peserta yang hadir untuk sama-sama memperjuangkan keadilan dengan cara yang benar.</p>\r\n<p>\"Asosiasi akan memberikan sumbangsih bagi kawan-kawan agar bisa beranjak lebih baik, kita bersama memperjuangkan keadilan dengan cara yang benar,\" kata dia. Menurutnya, untuk menuju kehidupan bangsa yang adil dan makmur diperlukan instrumen tata kelola negara yang baik. Juga, tata kelola sumber ekonomi yang diperuntukan bagi masyarakat, dan penegakan hukum. Dalam hal tata kelola sumber ekonomi, rakyat wajib punya lahan usaha di republik ini. \"Karena hampir 95 persen aset di negara ini dikuasai asing. Inilah cita-cita cita yang sedang kami perjuangkan untuk mengembalikan kedaulatan ekonomi kita,\" tuturnya.</p>','Selasa','2017-07-28','08:00:06','51medium_37polisi.jpg',56,''),(23,1,9,'Hary Tanoe Ditetapkan Sebagai Tersangka Oleh KPK','hary-tanoe-ditetapkan-sebagai-tersangka-oleh-kpk','Y','<p>REPUBLIKA.CO.ID, JAKARTA -- Mabes Polri telah menetapkan Hary Tanoesoedibjo sebagai tersangka kasus pesan kaleng. Hal itu dikeluarkan dengan dikeluarkannya surat perintah dimulainya penyidikan terhadap CEO MNC Group itu \"Iya benar, SPDP sudah diterbitkan, sebagai tersangka,\" tegas Karopenmas Polri Brigadir Jenderal Polisi Rikwanto, Jumat (23/6). Menurut Rikwanto, SPDP itu diterbitkan, Rabu (20/6) lalu. Selanjutnya, Hary Tanoe akan diagendakan untuk menjalani pemeriksaan sebagai tersangka, bulan Juli mendatang. \"Sejak dua hari lalu. Habis lebaran, awal Juli ini sudah ada rencana (pemeriksaan),\" kata Rikwanto.<br /> <br /> Sebelumnya, Jaksa Agung Muda Pidana Umum (Jampidum) Kejaksaan Agung Noor Rachmad mengatakan telah menerima SPDP atas kasus pesan kaleng yang menyeret HT. \"Tanggal 15 Februari 2016, SPDP sebagai terlapor. Belum ada tersangka. Tapi tanggal 15 juni 2017, Bareskrim Polri kirim SPDP atas nama tersangka HT,\" kata Rochmad di gedung Jampidum Kejagung, Jakarta, Kamis (22/6) . Untuk diketahui, kasus itu dilaporkan Kasubdit Penyidikan pada Jaksa Agung Muda Tindak Pidana Khusus (Jampidsus), Yulianto, pada 28 Januari 2016 lalu. Hary Tanoe dilaporkan atas dugaan tindak pidana pengancaman lewat pesan singkat (SMS). Yulianto, merupakan jaksa yang tengah menangani kasus dugaan korupsi perusahaan Mobile 8 di Kejaksaan Agung yang melibatkan Hary Tanoe.<br /> <br /> Penetapan tersangka Hary Tanoe, juga telah diumumkan oleh Jaksa Agung HM Prasetyo, (16/6) lalu. Hary sendiri membantah telah mengancam jaksa. Dia melaporkan Prasetyo atas tindak pidana pencemaran nama baik. Baca juga, <a href=\"http://www.republika.co.id/berita/nasional/hukum/17/06/19/orsb7a-ht-laporkan-jaksa-agung-atas-penyebutan-status-tersangka\">HT Laporkan Jaksa Agung Atas Penyebutan Status Tersangka</a>.</p>','Sabtu','2017-07-28','08:00:07','1413harie tanoe.jpg',57,''),(24,1,10,'Pemerintah Tetapkan Idul Fitri Jatuh pada 25 Juni 2017','pemerintah-tetapkan-idul-fitri-jatuh-pada-25-juni-2017','Y','<p>REPUBLIKA.CO.ID, JAKARTA -- Kementerian Agama telah selesai melaksanakan sidang isbat. Sidang isbat digelar bersama tokoh-tokoh ormas Islam dan memutuskan 1 Syawal 1438 Hijriah jatuh pada 25 Juni 2017. \"Kita sepakati malam ini sudah masuk 1 Syawal 1438 Hijriah, dan mulai besok kita bersama akan melaksanakan shalat Idul Fitri sebagaimana ketentuan yang berlaku,\" kata Menteri Agama Lukman Hakim Saifuddin, Sabtu (24/6). Ia menerangkan, penetapan didasarkan laporan posisi hilal berdasarkan kepada perhitungan hisab dengan ketinggian berada di 3,28 derajat. Sedangkan jarak busur bulan ke matahari 5,6 derajat. Umur bulan berusia 8 jam 15 menit.</p>\r\n<p>Untuk itu, Lukman mengatakan, keberadaan hilal bisa dilihat sesuai keputusan negara-negara ASEAN tentang batas ketinggian yaitu dua derajat. Namun, ia menekankan, Indonesia memakai dua metode perhitungan dan melihat langsung. \"Setidaknya, ada enam petugas Kemenag yang telah menyampaikan kesaksian bahwa mereka telah melihat hilal,\" ujar Lukman. Enam petugas itu di antaranya melakukan pantauan di Kupang, Nusa Tenggara Timur, Gresik dan Surabaya. Setelah mengucapkan selamat merayakan Hari Raya Idul Fitri 1438 Hijriah, Lukman berpesan agar masyarakat khususnya umat Islam bisa saling mengasihi. \"Selamat Hari Raya Idul Fitri, mudah-mudahan kita semua kembali suci dan saling mengasihi,\" kata Lukman.</p>','Sabtu','2017-07-28','08:00:08','9261idul fitri.jpg',58,''),(25,1,10,'Shalat Idul Fitri NTB Dipusatkan di Islamic Center','shalat-idul-fitri-ntb-dipusatkan-di-islamic-center','Y','<p>REPUBLIKA.CO.ID, MATARAM -- Pemerintah Provinsi Nusa Tenggara Barat (NTB) menyeru masyarakat terutama di Kota Mataram untuk memusatkan Shalat Idul Fitri 1438 Hijriah di Masjid Hubbul Wathan Islamic Center. Pengelola masjid sendiri telah membagi area shalat bagi jamaah.<br /> <br /> Ketua Pengurus Masjid Raya Hubbul Wathan Islamic Center NTB yang juga Sekretaris Daerah Provinsi NTB Rosiyadi Sayuti menyeru masyarakat untuk memusatkan pelaksanaan Shalat Idul Fitri 1438 H di <em>Islamic Center</em>. <em>Ballroom</em> <em>Islamic Center</em> ke selasar selatan hingga area parkir selatan akan jadi tempat shalat wanita. Sementara ruang shalat utama, lantai dua masjid, selasar utara hingga area parkir utara masjid akan jadi tempat shalat pria. \'\'Kami mohon jamaah dapat berwudhu dari rumah masing-masing karena area wudhu di teras masjid akan jadi tempat shalat,\'\' kata Rosiyadi.<br /> <br /> Shalat Idul Fitri akan dimulai pada pukul 07.00 WITA dan akan diimami qari internasional asal Yordania, Syekh Ahmad Jalal Abdullah Yahya dan khutbah akan disampaikan oleh Gubernur NTB GTH Muhammad Zainul Majdi. \'\'Ini akan jadi pengalaman pertama Syekh Ahmad Jalal mengimami kita di Lombok,\'\' kata Rosiyadi di Masjid Hubbul Wathan. Untuk parkiran kendaraan, parkir motor seluruhnya akan diarahkan di <em>basement</em> masjid. Sementara kendaraan roda empat yang datang pagi hari akan masuk area parkir Lapangan Pendidikan, di depan Kantor Imigrasi, Jalan Udayana, Jalan Langko, dan Jalan Pejanggik.</p>','Sabtu','2017-07-28','08:00:09','4417hubbul wathan.jpg',59,''),(26,1,10,'Ikuti Takbiran, Syekh Ahmad Jalal Selipkan Doa','ikuti-takbiran-syekh-ahmad-jalal-selipkan-doa','Y','<p>REPUBLIKA.CO.ID, MATARAM -- Qari asal Yordania Syekh Ahmad Jalal Abdullah Yahya yang telah mengimami 10 malam terakhir Ramadhan di Masjid Hubbul Wathan sempat hadir dalam acara Gema Takbir di perempatan Kantor Gubernur NTB. Di antara takbirnya, Sabtu (24/6), Syekh Ahmad Jalal menyelipkan shalawat dan doa. Sambil bertakbil, qari berdarah Palestina itu juga menyelipkan shalawat kepada Rasullah dan doa mohon ampunan bagi diri dan orangtua. Syekh Ahmad Jalal bergantian dengan Gubernur NTB TGH Muhammad Zainul Majdi memimpin takbir di panggung sambil melepas rombongan pawai Gema Takbir.</p>\r\n<p>Rombongan pawai Gema Takbir sendiri memulai rute dari simpang Kantor Gubernur NTB ke Simpang Kamboja lalu berbelok ke Jalan Catur Warga hingga pertigaan MAN 1 Mataram lalu ke Jalan Pejanggik dan berakhir di Islamic Center. Ada 29 ribu orang yang ikut dalam pawai ini. Peserta berasal dari berbagai kecamatan di Kota Mataram dan sekitarnya seperti dari Kecamatan Mataram, Kecamatan Selaparang, Kecamatan Cakranegara, Kecamatan Ampenan, Kecamatan Sekarbela, dan beberapa kecamatan lainnya.</p>\r\n<p>Pawai ini disaksikan ribuan warga yang berdiri berjajar di sepanjang Jalan Pejanggik, HOS Conkroaminoto, Jl Langko, dan area sekitar Taman Sangkareang. Warga nampak antusias dengan acara Gema Takbir ini. Saking semangatnya, pembawa acara berulang meng mengingatkan agar warga tak mengikuti rombongan pawai takbir.</p>','Sabtu','2017-07-28','08:00:10','26medium_42takbiran.jpg',62,''),(27,1,9,'Politikus PKS: Pembangunan NTB On The Track Dipimpin TGB','politikus-pks-pembangunan-ntb-on-the-track-dipimpin-tgb','Y','<p>REPUBLIKA.CO.ID, JAKARTA -- Anggota Komisi VII DPR RI dari Fraksi Partai Keadilan Sejahtera (PKS) Zulkieflimansyah mengatakan, pembangunan Nusa Tenggara Barat (NTB) sudah <em>on the track</em> dibawah kepemimpinan Gubernur Muhammad Zainul Majdi. Untuk itu, apa yang telah dilakukan oleh Tuan Guru Bajang (TGB) harus terus dilanjutkan.<br /> <br /> \"Kesinambungan pembangunan di NTB harus diteruskan dan dilanjutkan agar masyarakat NTB bisa melebihi provinsi lain,\" kata Zulkieflimansyah, Rabu (10/5). Zulkieflimansyah melanjutkan, salah satu faktor kunci pada Pilgub NTB 2018 ada di tangan Gubernur NTB, Tuan Guru Bajang (TGB). Politikus PKS itu juga menyatakan siap maju di Pilgub NTB 2018 jika dipercaya.&nbsp; \"Saya siap maju sebagai calon gubernur NTB,\" ujarnya.<br /> <br /> Dalam beberapa kesempatan, TGB memuji sosok Zulkieflimansyah yang mengharumkan nama NTB di di dunia pendidikan. Menanggapi pernyataan TGB, Zulkieflimansyah berkeyakinan, apa yang menjadi tujuan pembangunan di NTB akan terwujud dan hal itu sesuai dengan cita-citanya. \"Saya tambah mantap untuk maju bila TGB mendukung saya sebagai calon gubernur NTB,\" ucapnya.</p>','Kamis','2017-07-28','08:00:11','2548zulkieflimansyah-_140225122246-352.jpg',61,'politik'),(28,1,9,'Sohib TGB Nilai Zainul Majdi Figur Pemimpin Nasional Ideal ','sohib-tgb-nilai-zainul-majdi-figur-pemimpin-nasional-ideal-','Y','<p>REPUBLIKA.CO.ID, JAKARTA -- Gubernur Nusa Tenggara Barat (NTB) TGKH. M. Zainul Majdi atau yang juga sering disapa Tuan Guru Bajang (TGB) dinilai sebagai salah satu pemimpin yang layak maju ke level nasional. TGB dinilai sebagai <em>role model</em> figur pemimpin Indonesia kedepan. \"TGB adalah figur pemimpin muda yang ideal dan tepat untuk memberikan contoh kepada generasi muda bangsa bahwa anak muda bisa berprestasi dengan di dasari Ilmu Agama yang kuat,\" ujar juru bicara Sohib TGB, Valdy Ashab Firdausi.<br /> <br /> Ia mengatakan, TGB merupakan seorang pemimpin yang bersih dan mampu membangun daerah yang dipimpinya menjadi jauh lebih baik dan berkembang. Terbukti dengan berbagai penghargaan yang diraihnya. Diketahui TGB juga merupakan seorang Hafidz Quran. \"Memang Indonesia bukan negara Islam. Tapi dengan mayoritas penduduknya Muslim, tentu perlu juga penduduk muslim memiliki seorang tauladan yang bisa dicontoh. Tuan Guru adalah figur muda yang layak menjadi pemimpin nasional,\" pungkas Valdy. Aspirasi masyarakat yang menginginkan TGB maju dalam bursa Pilpres 2019 mendatang sebelumnya memang banyak terdengar. Namun TGB sendiri mengatakan dirinya masih fokus dalam menyelesaikan kepemimpinan sebagai Gubernur NTB yang akan berakhir hingga 2018 mendatang.<br /> <br /> \"Masih banyak hal yang harus dikerjakan, pelaksanaan tugas tidak boleh pecah fokus dengan yang lain. Saya harus fokus betul-betul agar menyelesaikan apa yang belum terlaksana,\" kata TGB di Golden Palace, Mataram, NTB, Rabu (3/5). TGB menilai, aspirasi ini bukan yang pertama, dan juga tidak semata kepada dia, melainkan para putra-putri NTB lain yang dianggap memiliki kualitas di kancah nasional.&nbsp;</p>','Kamis','2017-07-28','08:00:12','3666tgb1.jpg',62,'politik'),(29,1,8,'Mark Zuckerberg Ikut Buka Puasa Bersama Pengungsi Somalia','mark-zuckerberg-ikut-buka-puasa-bersama-pengungsi-somalia','Y','<p>REPUBLIKA.CO.ID, MINNEAPOLIS -- CEO Facebook, Mark Zuckerberg, ikut makan malam iftar atau buka puasa dengan sejumlah pengungsi Somalia di Minneapolis, Kamis (22/6) lalu. Bahkan, ia tidak segan mengungah foto-foto kebersamaannya saat ikut buka puasa. \"Malam ini saya makan malam iftar pertama dengan sekelompok pengungsi Somalia di Minneapolis,\" kata Zuckerberg seperti dilansir laman <em>Punchng</em>, Sabtu (24/6). Dalam unggahannya itu, ia berpendapat, sebagai pengungsi kita tentu tidak bsia memilih di negara mana anda akan berada. Zuckerberg turut membagi kisah seorang pria yang telah habiskan 26 tahun di kamp pengungsi, yang sempat ditemuinya.<br /> <br /> Menurutnya, jawaban orang itu begitu sederhana tapi dalam, ketika ditanya apakah saat ini Amerika sudah terasa seperti rumah. Pasalnya, orang itu mengiyakan dengan menjawab kalau rumah adalah tempat anda bebas melakukan yang diinginkan. \"Sungguh penghormatan yang indah untuk Amerika,\" ujar Zuckerberg. Ia pun berterima kasih kepada tuan rumah karena begitu murah hati mengajaknya di akhir Ramadhan. Zuckerberg mengaku kagum dengan kekuatan dan ketabahan para pengungsi, untuk memabangun hidup baru di tempat yang asing&nbsp; \"Anda adalah pengingat kuat mengapa negara ini begitu hebat,\" kata Zuckerberg menutup unggahannya.</p>','Kamis','2017-07-28','08:00:13','7477mark-zuckerberg-_170314092514-486.jpg',63,'hiburan'),(30,1,10,'Tuan Guru Bajang Penuhi Undangan Safari Dakwah di Yogyakarta ','tuan-guru-bajang-penuhi-undangan-safari-dakwah-di-yogyakarta-','Y','<p>REPUBLIKA.CO.ID, MATARAM -- Ketua Umum Pengurus Besar Nadhlatul Wathan (PBNW) akan menggelar safari dakwah jelang bulan suci Ramadhan atas undangan sejumlah pihak di wilayah Daerah Istimewa Yogyakarta (DIY) dan sekitarnya. Perjalanan pria yang dikenal sebagai Tuan Guru Bajang (TGB) akan dimulai dengan mengunjungi Pondok Pesantren (Ponpes) Ibnu Abbas di Klaten, Jawa Tengah, pada Jumat (12/5) pagi. Dari Klaten, pria yang masih menjabat sebagai gubernur NTB langsung melanjutkan perjalanan menuju Masjid al Firdaus, Ngoto, Bantul, Yogyakarta dan menjadi khatib salat Jumat di masjid tersebut, yang dilanjutkan dengan silaturahmi bersama para ulama, para pejabat, dan tokoh agama di Bantul.<br /> <br /> Selepas silaturahmi di Bantul, TGB yang merupakan seorang penghapal alquran akan menyaksikan setoran hafalan hafidz se-Yogyakarta di Rumah Tahfidz, Deresan, Sleman dan memberi motivasi kepada para tahfidz cilik. Malam harinya, TGB akan menghadiri pertemuan dengan tokoh dan ulama di Kota Yogyakarta yang digagas Forum Umat Islam (FUI) DIY. Keesokan harinya, Sabtu (13/5), TGB akan bersilaturahmi ke beberapa tempat di Jogja seperti Masjid Jogokariyan, bertemu dengan masyarakat NTB di Jogja, dan silaturahmi ke kantor Muhammadiyah dan NU di Jogja. Malam harinya, TGB akan mengisi tausiyah dalam tablig akbar di Masjid Gedhe Kauman, Yogyakarta, dengan tema \"Menuntut Ilmu dan Menjalin Ukhuwah\".<br /> <br /> Hari terakhir pada Ahad (14/5), TGB akan memberi tausiyah di beberapa tempat seperti Masjid Nurul Asri, Deresan, Sleman, Yogyakarta, dan tablig akbar di alun-alun Kota Magelang, Jawa Tengah. TGB mengaku sangat bersyukur bisa menjalin silaturahmi dengan berbagai lapisan eleman umat Islam di Yogyakarta dan sekitarnya. \"Semoga safari dakwah dan silaturahmi ini bisa memberi barokah bagi kita semua,\" kata TGB kepada <em><strong>Republika.co.id</strong></em>, Kamis (11/5).</p>','Sabtu','2017-07-28','08:00:14','5752tgb2.jpg',65,'');

