insert  into `halaman_statis`(`id_halaman`,`judul_halaman`,`link_halaman`,`isi_halaman`,`aktif`) values (1,'About Us','?module=carabeli','<h5 style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Sebuah bisnis biasanya sangat bergantung pada aplikasi, layanan, dan data yang terdapat dalam data center, menjadikannya titik fokus dan aset penting dalam keperluan sehari-hari. Data center juga berfungsi sebagai principal repositories untuk segala macam peralatan IT, termasuk server, subsistem penyimpanan,&nbsp; networking switches, router dan firewall, serta pemasangan kabel dan physical racks yang digunakan untuk mengatur dan menghubungkan peralatan IT.</span></h5>','Y'),(4,'Company Profile','?module=profil','<div class=\"elementor-column elementor-col-33 elementor-top-column elementor-element elementor-element-b48956f\" data-id=\"b48956f\" data-element_type=\"column\">\r\n<div class=\"elementor-widget-wrap elementor-element-populated\">\r\n<div class=\"elementor-element elementor-element-50d01e7 elementor-widget__width-auto elementor-widget elementor-widget-heading\" data-id=\"50d01e7\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"et_pb_with_border et_pb_row et_pb_row_0\">\r\n<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_0  et_pb_css_mix_blend_mode_passthrough et-last-child\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_0  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<h2>Selamat Datang Di PT. Trinusa Technologies</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"et_pb_row et_pb_row_1\">\r\n<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_2  et_pb_css_mix_blend_mode_passthrough et-last-child\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_1  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<p>PT. Trinusa Technologies adalah perusahaan Teknologi Informasi yang diberdiri sejak tahun 2010. Perusahaan ini bergerak dan fokus di bidang Konsultan IT dan System Integrator yang menyediakan solusi infrastruktur jaringan berupa Networking, Security System, Automation (SDN), Data Center, Virtualization, System Monitoring, dan Unified Communication baik berupa Hardware maupun Software. Disamping itu, perusahaan ini didedikasikan agar menjadi perusahaan yang mampu memberikan solusi dan layanan TI terbaik kepada klien-kliennya.</p>\r\n<p>PT. Trinusa Technologies sebagai rekanan bisnis yang handal dan dipercaya, memberikan solusi untuk semua kebutuhan bisnis Anda akan solusi Teknologi Informasi dan Komunikasi. Merencanakan solusi secara jelas dan memberikan teknologi terkini dan solusi adalah komitmen kami. Fokus pencapaian kami adalah pada hasil yang berkualitas dan kepuasan pelanggan. Oleh karenanya, kami melakukan perbaikan secara terus-menerus untuk meningkatkan kualitas SDM, proses bisnis, serta mutu layanan dan produk yang kami tawarkan.<br /><br /></p>\r\n<div class=\"et_pb_row et_pb_row_2\">\r\n<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_4  et_pb_css_mix_blend_mode_passthrough et-last-child\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_3  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<h1>VISI PERUSAHAAN</h1>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"et_pb_row et_pb_row_3\">\r\n<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_5  et_pb_css_mix_blend_mode_passthrough\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_4  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<p>Menjadi perusahaan IT yang terpercaya dan penyedia solusi Teknologi Informasi dan Komunikasi yang handal.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"et_pb_row et_pb_row_3\">\r\n<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_5  et_pb_css_mix_blend_mode_passthrough\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_4  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<p>&nbsp;</p>\r\n<h1>MISI PERUSAHAAN</h1>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_6  et_pb_css_mix_blend_mode_passthrough et-last-child\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_5  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<p>Dapat memberikan solusi dan layanan sistem integrasi teknologi informasi yang efektif dan nilai tambah terhadap perusahaan menengah hingga besar yang menginginkan kinerja jaringan yang tinggi, handal dan aman, serta membantu perusahaan tersebut mendapatkan manajemen installation dan maintenance yang terbaik sehingga meningkatkan efektivitas, efisiensi, dan produktivitas infrastruktur TI yang dimiliki oleh pelanggan.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"et_pb_row et_pb_row_4\">\r\n<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_7  et_pb_css_mix_blend_mode_passthrough et-last-child\">\r\n<div class=\"et_pb_module et_pb_text et_pb_text_6  et_pb_text_align_left et_pb_bg_layout_light\">\r\n<div class=\"et_pb_text_inner\">\r\n<p>Dengan pengalaman telah mengerjakan beberapa proyek di bidang Teknologi Informasi selama ini, PT. Trinusa Technologies selalu menyertai perjalanan bisnis para pelanggannya. Tangan-tangan profesional setiap karyawan PT. MSI terus berkarya menghasilkan inovasi untuk menjawab tantangan perubahan zaman.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Y');

