insert  into `profil`(`id_profil`,`static_content`,`gambar`,`nama_toko`,`alamat`,`meta_deskripsi`,`meta_keyword`,`nomor_rekening`,`nomor_hp`,`pin_bb`,`email_pengelola`,`host`,`port`,`password`,`email_protokol`,`alamat_web`) values (1,'<div class=\"elementor-element elementor-element-ed46f43 elementor-widget elementor-widget-heading\" data-id=\"ed46f43\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Software Development Agency</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-dfe6f9a elementor-widget elementor-widget-text-editor\" data-id=\"dfe6f9a\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Dengan pengalaman telah mengerjakan beberapa proyek di bidang Teknologi Informasi selama ini</p>\r\n</div>\r\n</div>','logo.png','Pijar Online','Jl. Pendidikan No 10 Mataram','Script Toko Online Termurah','fashion, online','Mandiri 131-xxx-xxx-xxxx an. Multazam','081805727985','<p><strong>Trinusa Technologies</strong> menyediakan solusi untuk membangun dan mendisain jaringan komputer Anda ke dalam kelompok dua atau lebih perangkat komputer secara bersamaan. Dengan cara ini Anda dapat berbagi data di seluruh jaringan Anda dengan jaringan Data Center yang mengendalikan dan menyusuri semua informasi perusahaan.</p>\r\n<p>Ada banyak jenis jaringan, tetapi jenis jaringan yang paling umum adalah Local-Area Networks (LANs) dan Wide-Area Networks (WANs). Untuk membangun jaringan LAN, kami bisa memberikan solusi implementasi jaringan tradisional Campus LAN atau teknologi SDN terkini. Untuk jaringan WAN, dengan berbagai layanan koneksi antara Head Office dan Branch kami bisa memberikan solusi implementasi menggunakan teknologi WAN terkini (SD-WAN).</p>','support@trinusatech.com','webmail.trinusatech.com','8080','trinusa123','SMTP','http://localhost/trinusatech.com');

